import React from 'react';

const SettingsModal = ({ isOpen, onClose, language, setLanguage }) => {
  if (!isOpen) return null;

  const handleSave = () => {
    // Save settings to localStorage or send to API
    console.log('Settings saved:', { language });
    onClose();
  };

  const handleOverlayClick = (e) => {
    if (e.target === e.currentTarget) {
      onClose();
    }
  };

  return (
    <div className="modal-overlay" onClick={handleOverlayClick}>
      <div className="modal-content glass-card">
        <div className="modal-header">
          <h2>Settings</h2>
          <button className="close-button" onClick={onClose}>
            ×
          </button>
        </div>
        
        <div className="modal-body">
          <div className="setting-group">
            <label className="setting-label">Default Language:</label>
            <select
              value={language}
              onChange={(e) => setLanguage(e.target.value)}
              className="setting-select"
            >
              <option value="en">English</option>
              <option value="es">Spanish</option>
              <option value="fr">French</option>
              <option value="de">German</option>
              <option value="it">Italian</option>
              <option value="pt">Portuguese</option>
              <option value="ru">Russian</option>
              <option value="ja">Japanese</option>
              <option value="zh">Chinese</option>
            </select>
          </div>

          <div className="setting-group">
            <label className="setting-label">Recording Quality:</label>
            <select className="setting-select">
              <option value="standard">Standard</option>
              <option value="high">High</option>
              <option value="ultra">Ultra</option>
            </select>
          </div>

          <div className="setting-group">
            <label className="setting-label">Auto-translation:</label>
            <div className="toggle-switch">
              <input type="checkbox" id="auto-translate" defaultChecked />
              <label htmlFor="auto-translate" className="toggle-label">
                <span className="toggle-slider"></span>
              </label>
            </div>
          </div>

          <div className="setting-group">
            <label className="setting-label">Speaker Detection:</label>
            <div className="toggle-switch">
              <input type="checkbox" id="speaker-detection" defaultChecked />
              <label htmlFor="speaker-detection" className="toggle-label">
                <span className="toggle-slider"></span>
              </label>
            </div>
          </div>
        </div>
        
        <div className="modal-footer">
          <button className="btn-secondary" onClick={onClose}>
            Cancel
          </button>
          <button className="btn-primary" onClick={handleSave}>
            Save Settings
          </button>
        </div>
      </div>
    </div>
  );
};

export default SettingsModal;
